Vertigo comics
cbr

In Part 2 of Inherit the Wind, we meet the other three Cardinal Winds, West, East and South - as the cubs continue to learn about the life and responsibilities of their grandfather, the North Wind.

Meanwhile, Bufkin continues to wreak havoc in Oz by starting a revolution with his usual monkey business.
